	public static byte[] decodeToByte(String imgData) throws IOException
	{
		BASE64Decoder decoder = new BASE64Decoder();
		return decoder.decodeBuffer(imgData);
		
	}
	public static Map<String, String> getMapFromJson(String jsonString) {
	    Map<String, String> map = new HashMap<>();
	    try {
	        JSONObject object = new JSONObject(jsonString);
	        Iterator<?> iterator = object.keys();
	        while (iterator.hasNext()) {
	            String key = (String) iterator.next();
	            if(!key.isEmpty() && !object.getString(key).isEmpty()){
	                map.put(key, object.getString(key));
	                System.out.println("key :" + key + "--- " + object.getString(key));
	            }
	        }
	    } catch (JSONException e) {
	        e.printStackTrace();
	    }
	    return map;
	}
